INSERT INTO `gb` (`id`, `username`, `phone`, `msg`, `answer`, `dt`, `img`, `alt`, `total_value`, `total_votes`, `url`, `category`, `art`, `ip`) VALUES
(85, 'Ирина', '', 'Купили стол парту для дочки. Все в восторге! Идеально вписалась в интерьер. Конструкция отличная! Спасибо Игорю который качественно и быстро собрал парту! ', '', '2015-04-09 19:54:41', 'img_98csd77njdhds45.jpg', '', 5, 1, '14-01r', 'parta_s_risunkom', 'cyt14', ''),
(2, 'Владимир', '', 'Присматривали Moll, но потом остановились на Дэми. Хорошее качество, отличная цена, ребенок доволен.', '', '2013-01-07 15:32:00', 'IMG_1757.JPG', '', 5, 1, '15-04', 'parta_so_stulom', '', ''),
(3, 'Мария', '', 'Нам тоже очень понравилось', '', '2013-01-07 18:29:45', 'IMG_1749.JPG', '', 5, 1, '15-05', 'parta_so_stulom', '', ''),
(4, 'Людмила', '', 'Здравствуйте! \r\nХочу добавить свой положительный отзыв. Для старшего сына, которому скоро идти в первый класс, год назад был куплен комплект детской мебели отечественного производителя ООО «ПК «ДЭМИ» (г.Пермь): стол и стул. \r\nИз плюсов конструкционных особенностей: комплект детской мебели ДЭМИ очень легкий, легко и удобно складывается,отлично отмывается,места в детской занимает немного: в разложенном состоянии с задвинутым стульчиком всего по площади 60х45 см. \r\nДизайн просто великолепный, выше всяких похвал, поскольку рабочая поверхность оформлена ярко, на различную тематику. С ее помощью сынок очень легко выучил названия месяцев и времен года, все буквы алфавита, цифры, даже названия материков, словом все, что изображено на рабочей поверхности стола, нам пригодилось для расширения кругозора дошкольника. И даже, думаю, еще не весь потенциал этой замечательной детской мебели нами исчерпан, поскольку учить таблицу умножения шестилетнему ребенку еще рановато. \r\nИз минусов нами было замечено только два, но не очень существенных. Во-первых, столешница имеет подобие пленочной поверхности, которую ребенок достаточно быстро расцарапал, но в глаза этот дефект не бросается и занятиям не мешает. Во-вторых, посреди столика нарисовано изображение циферблата, подозреваю, что для того, чтобы ребенок смог научиться определять время. К сожалению, из-за того, что рисунок изображен слегка под углом и с неполным набором цифр, различать время по нему ребенок так и не научился. Думаю, если бы рисунок циферблата был обычным, как в настоящих часах, он воспринимался бы лучше. \r\nВо всем прочем нареканий нет, мебель вполне вандалоустойчивая, ребенок пользуется и очень доволен.', '', '2013-01-10 09:44:04', '3355C1kgv1-0.jpg', '', 5, 1, 'doshkolenok', '', '', ''),
(87, 'Андрей', '+79615054140', 'Отличная мебель! Ребенок очень доволен. Собирал сам, ничего сложного, ко всему есть инструкция. Всем рекомендую, о покупке не пожалеете!', '', '2015-05-18 12:13:20', 'P1030853.JPG', '', 5, 1, '14-01', 'parta_bez_risunka', 'cyt14', '128.71.146.154'),
(88, 'Наталья', '89377513076', 'Ребенок доволен.Парта очень удобная и не занимает много места.Дочке нравится не только заниматься ,но и играть на столе.', '', '2015-05-23 22:42:26', 'img_jsf8479230.jpg', '', 5, 1, '14', 'parta_bez_risunka', 'cyt14', '93.81.205.103'),
(6, 'Денис Тарасов', '', 'Здравствуйте! \r\n\r\nМы заказывали у Вас комплект: \r\n1. Комплект ДЭМИ СУТ 15-04 клен / синий \r\n2. Накладка на стол 65х51 прозрачная \r\n3. Чехол для стула Дэми (СУТ-01) Замша бежевый \r\n\r\nВсе пришло в срок и полной комплектации. Порадовал сам конструктив мебели - на вид очень надежные и долговечные парта со стулом. Видео уроки не смотрел, хватило инструкций уложенных в коробки. Все очень доступно, а главное понятно написано. Сборка заняла примерно около 3 часов и это с перекурами. \r\n\r\nСпасибо, будем теперь тестить по полной эргономику ребенка, ежели все гуд будет, то на следующий год еще комплект такой же будем брать!', '', '2013-03-05 10:30:22', '', '', 5, 1, '15-04', 'parta_so_stulom', '', ''),
(7, 'Игорь', '', 'Отличная парта, отличная цена(на других сайтах дороже). Ребенок доволен, учится с 1 класса, сейчас в 3 классе  . Доставили на следующий день после заказа и сразу собрали, быстро и аккуратно. Спасибо. ', '', '2013-03-05 10:30:48', '136577855194958700.jpg', '', 5, 1, '14-01', 'parta_so_stulom', '', ''),
(8, 'Тата', '', 'Пользуемся партой второй год, оказалась очень хоршей качественной и удобной. Я редко пишу отзывы о приобретенных вещах, но в данном случае хотелось написать. Отдельная благодарность разработчикам и производителю.', '', '2013-03-05 10:31:12', 'DSC02841.JPG', '', 5, 1, '14-01', 'parta_so_stulom', '', ''),
(9, 'Елена', '', 'Мы подарили такую парту своему первокласснику. Доставили прям в день рождения сына и сделали еще и подарок. Очень приятно, спасибо огромное!! \r\nПарта нам очень нравится, особенно хорошо, что она регулируется по высоте. Что очень важно для здоровья ребенка и экономически выгодно. И еще достанется по наследству младшему братику. \r\nТак что советуем всем родителям, кто заботится о здоровье своих деток приобрести такую мебель))))', '', '2013-03-05 11:40:18', '', '', 5, 1, '14-02', 'parta_so_stulom', '', ''),
(10, 'Гость', '', 'Пользуемся мебелью уже третий год!!! Всем довольны!!!! Ничего еще не сломалось! Теперь хотим докупить еще тумбу на колесах и стеллаж с ящиками, но наша мебель в цвете яблоня!!!! Почему сразу не выпустили мебель во всех цветах как и парты? Ведь дело в технологии конструкции, а не в цвете дерева из которого оно сделано?', '', '2013-03-05 11:40:45', '', '', 5, 1, '14-01', 'parta_so_stulom', '', ''),
(11, 'Наталья', '', 'Используем стул и парту Деми уже 3-й год. Всем довольны. Но, к сожалению, у нас треснуло сиденье. Скажите, пожалуйста, можно ли у вас приобрести отдельно сиденье для стула?', 'Красовский Игорь<br>Да, спинка и сиденье продаются отдельно. Вместе с сиденьем поставляется дополнительный упор. С недавних пор завод усилил пластмассу с обратной стороны ребрами жесткости и комплектует стулья дополнительным упором, тем самым проблема была решена. ', '2013-03-05 11:41:10', '1267970794188.jpg', '', 4, 1, '14-01', 'parta_so_stulom', '', ''),
(148, 'Елена', '', 'Заказали парту ДЭМИ и кресло Меалюкс. Ребята собрали все за час, настроили под рост ребенка,  показали как что регулировать, мы довольны. ', '', '2018-03-01 09:29:31', '28158696_172699043362205_2242298422608527360_n.jpg', '', 5, 1, '17-03', 'parta_bez_risunka', 'cyt17', '37.146.50.35'),
(12, 'Гость', '', 'можно ли стол поставить на колеса, т.к. ребенок ДЦП и было бы удобнее стол придвигать к нему', 'Красовский Игорь<br>Можно, у подпятников парты стандартное крепление, в которое можно закрутить колеса. Я знаю, что некоторые из наших покупателей так и поступали. Рекомендуем вкручивать только 2 колеса, а не 4, чтобы стол не отъезжал от ребенка', '2013-03-05 11:44:46', '', '', 0, 0, '14-01', 'parta_so_stulom', '', ''),
(13, 'Александр', '', 'Я недавно уже купил младшему ребенку стол. Ваши столы Дэми, надо отдать должное, подкупают своими многочисленными регулировками и возможностями трансформации. Конечно, тогда я не знал, что есть такие столики, впервые жалею, что не стал &quot;заморачиваться&quot; при выборе. Через некоторое время задумаюсь о покупке Вашей парты.', '', '2013-03-05 11:47:00', '', '', 0, 0, '', '', '', ''),
(14, 'Татьяна', '', 'Спасибо! Очень удачная покупка! Мне показалось, что на фото мебель смотрится как-то грубовато, но все очень аккуратно, продуманно сделано. Купили стулья- новинки из фанеры, так фанера лаком покрыта, на спинке изящный изгиб. Собирали сами и муж сказал, что очень толковая инструкция. Замечательно и то, что делают это наши. Еще раз спасибо!', '', '2013-03-05 11:47:18', '', '', 5, 1, '14-02', 'parta_so_stulom', '', ''),
(15, 'Елена', '', 'Столкнулись с проблемой, крючки для портфелей просто ватные, они на полотенца рассчитаны! Сейчас думаем, железные в металлическую ножку прикреплять ,на весь класс-20 парт.И царапины чем замазывать? Стулья наверх ставили, и болтами задели полироль!', 'Красовский Игорь<br>Крючок рассчитан на вес портфеля с учебниками. Можете поискать в магазине мебельной фурнитуры специальную полироль (стоит 50 руб), возможно она Вам поможет. Цвета парты: клен и яблоня.', '2013-03-05 11:50:53', 'orel2.jpg', '', 3, 1, '14', 'parta_so_stulom', '', ''),
(16, 'Гость', '', 'Партой СУТ 14-02 довольны и я, и муж, и главное сын. При сборке понравилось, что все детали по отдельным пакетикам с рисунками и номерами. Очень понравился стул, тяжелый (т.е. так просто не опрокинется когда ребенок балуется), внизу резиновые накладки (т.е. пол не царапается) и удобный, только высоту не очень удобно менять - надо болты перекручивать , ну да это не часто будет( У стола высоту просто менять.) Спасибо!', '', '2013-03-05 18:58:29', '', '', 5, 1, '14-02', 'parta_so_stulom', '', ''),
(17, 'Юлиса', '', 'Тоже получили свой заказик парту, стул и тумбу, очень довольны и муж и я, ребенок еще не видел отдыхает, мне прямо стул ну очень понравился, еще чехол покупали (очень удобная вещь... и мягко и удобно, СУПЕР!!!) с письменным столом даже не в какое сравнение не идет....', '', '2013-03-05 19:02:41', 'IMG_0459sjfhmsehfjsef.JPG', '', 5, 1, '14', 'parta_so_stulom', '', ''),
(18, 'Настена', '', 'Купили дочке парту и стул, обычной комплектации. Ей очень нравится, она решила лично написать свои впечатления об использовании. \r\n&quot;Мне очень понравилась парта и стул. За партой очень комфортно сидеть. За ней можно творить что угодно: и читать, и рисовать, и писать. Хочу чтобы моему младшему брату купили такую же парту со стулом!', '', '2013-03-13 09:36:33', '', '', 5, 1, '14-01', 'parta_so_stulom', '', ''),
(19, 'Гость', '', 'Парта очень понравилась мне и ребенку, брали новую модель 120 см с 2 столешницей и с ящиком, но блин собирали ее долго и нудно, не было отверстий для крепления ящика с нужной стороны, потом отверстия в столешнице не совпали с механизмом. В ящике 1 ящичек практически не работал. В итоге конечно все собрали, но нервничали. \r\nОчень понравилось в инструкции ссылки на пакеты с гайками, спасибо! \r\nИ еще мне показалось на стуле ооочень тонкий пластик, хотя стул очень масивный и устойчивый. \r\nНадеюсь фирма учитывает свои недочеты в будущем!', '', '2013-03-13 09:36:48', 'IMG_0212.JPG', '', 4, 1, '17-04', 'parta_so_stulom', '', ''),
(20, 'Андрей', '', 'Сын учится в 1 классе. Три месяца назад приобретена парта «ДЭМИ» СУТ 14-01-K, отличное качество. Спасибо. \nPS Сборка парты не составляет трудностей. ', '', '2013-04-13 15:25:02', 'img_fhsd87983234mc.jpg', '', 5, 1, '14', 'parta_so_stulom', '', ''),
(21, 'Елена', '', 'Добрый ден. Нужно ли при заказе уточнять у СУТ-15-03 с какой стороны повесить  тумбу (на левую сторону парты как на фото)?\n<br><br>\n<div class=\"admin\">\nПодвесные тумбы, боковые приставки, подъемные столешницы, вся линейка мебели сут 15 сут 14 и сут 17 универсальна и элементы мебели могут быть, как слева так и справа. Решается это при сборке. Никакие дополнительные отверстия не нужны.								</div>', '', '2013-05-07 15:25:53', 'IMG_0199.JPG', '', 0, 0, '15-03', 'parta_so_stulom', '', ''),
(22, 'Светлана Ивановна', '', 'Очень довольна и партой и работой магазина, все оперативно собрали, спасибо.', '', '2013-05-07 19:21:36', 'otz009b.jpg', '', 5, 1, '14-02', 'parta_so_stulom', '', ''),
(23, 'Инга', '', 'Здравствуйте Дэми. Приобретали у вас большой стол. Очень удобная тумба, особенно пластиковый отсек для письменно-рисовальных дел. Так же здорово, что тумбу можно крепить с любой стороны , у нас ребёнок левша поэтому парта то, что нужно.', '', '2013-05-07 19:25:06', 'skldkdlfdsf.jpg', '', 5, 1, '15-04', 'parta_so_stulom', '', ''),
(24, 'Виталий', '', 'Купил такой стул ребенку. Вначале смутило что пр-во китай, но в итоге не пожалел. качество и удобство на высоте!', '', '2013-05-12 17:21:51', '1311866401_6.jpg', '', 5, 1, 'lbc01', 'ergonomichnyj_stul', '', ''),
(25, 'Ирина', '', 'Молодцы! Ребенок в полном восторге!!!  Проблем с доставкой не было. Даже наш требовательный папа сказал: \"Мебель надежная. Сборка логичная и понятная\" Спасибо огромное!!! Будем расти вместе с Вашей мебелью!!!!', '', '2013-07-02 19:30:24', '', '', 5, 1, '17-04', 'parta_so_stulom', '', ''),
(26, 'Наталия', '', 'Большое спасибо за мебель! Взяли обычную парту со стулом и стеллаж с тумбой! Все одновременно компактно, но в то же время вместительно! Ребенок доволен! А младшему настолько понравилось, что видимо придется и ему место оборудовать))))))) Отдельное спасибо сотруднику магазина - Игорю, который грамотно проконсультировал, быстро доставил по адресу, и еще все это собрал и установил! Вот что у нас получилось:', '', '2013-07-06 22:19:30', 'эми.jpg', '', 5, 1, '14', 'parta_so_stulom', '', ''),
(27, 'Наталья', '', 'Прекрасный магазин! Здесь нашла как раз то, что искала на многих сайтах и по меньшей  цене - спинку и сиденье для стула от набора мебели ДЭМИ.  Спасибо большое магазину, теперь знаю, где можно найти необходимые комплектующие.  ', '', '2013-07-13 13:44:54', '', '', 0, 0, '', '', '', ''),
(28, 'Дина', '', 'Купили комплект СУТ 14-02, отверстия в столе просверлены не там где надо, очень разочарованы, нет качества за такие деньги! Возвращаем сумму...\r\n<br><br>\r\n<div class=\"admin\">\r\nДиана, добрый день. Свяжитесь, пожалуйста, с нами							 по телефону: +7 (988) 242-81-05.<br>Редко, но, к сожалению, встречается брак. Мы Вам бесплатно поменяем бракованную деталь и привезем или отправим транспортной компанией. Это гарантийный случай.<br>С уважением, Красовский Игорь</div>', '', '2013-07-29 20:33:59', '', '', 0, 1, '14-02', 'parta_so_stulom', '', ''),
(29, 'Алёлик', '', 'Всем за парту спасибо,просто чудо., и почему пермскую телогрейку и пермский лес раньше не вспомнили....:),шутка, все очень понравилось, просто без заморочек, понятно в общем сама собирала с большим интересом, а дети помогали........', '', '2013-08-02 12:02:41', '37917928428300483.jpg', '', 5, 1, '14-01', 'parta_so_stulom', '', ''),
(30, 'Сергей', '', 'Набор трансформируемой мебели «ДЭМИ» СУТ 15-05. В пятницу заказал во вторник трнспортная компания уже доставила в Волгоград. Сам собрал за 3 часа без какой- либо практики. В инструкции по сборке все подробненько описано. Большой плюс что все (парта, стул) не легкое, основательно стоит. На задней полке прекрасно поместился моноблок. Отличный подарок дочке-первоклашке!\r\n    У производителя хочется попросить выпустить навесные горизонтальные полки для книг итд.', '', '2013-08-06 00:28:59', '', '', 5, 1, '15-05', 'parta_so_stulom', '', ''),
(31, 'Оксана', '', 'Спасибо большое за отличную парту. Доставили в день заказа, собрали сразу и сами, очень легко, лишних деталей не осталось)))))Парта очень удобная и стул тоже, будем пользоваться с удовольствием)))', '', '2013-08-08 14:11:57', '571199125.jpg', '', 5, 1, '14-01', 'parta_so_stulom', '', ''),
(32, 'Лусина', '', 'Прекрасное решение для школьника.Все оперативно,спасибо.', '', '2013-08-10 10:39:48', '', '', 5, 1, '14-01', 'parta_so_stulom', '', ''),
(33, 'Карина', '', 'Купила дочке 3,5 лет парту с задней полкой. Теперь подумываю и о боковой. Сидя ребенок до задней полки не дотягивается, так что рисовать неудобно. Партой я очень довольна. Да и дочка домашние задания стала делать гораздо охотней.\r\nОтдельное спасибо производителям за подробнейшую инструкцию, парту я собрала сама часа за полтора, несмотря на активную помощь будущей хозяйки. Качество материалов тоже на высоте: что только дочь на ней ни разливала, чем только ни разрисовывала. Спустя полгода выглядит как новая.\r\nОчень бы хотелось иметь выдвижной ящик для мелочей под столешницей.', '', '2013-08-14 20:37:27', '1860624388.jpg', '', 5, 1, '14-01', 'parta_so_stulom', '', ''),
(34, 'Елена', '', 'Пластик на стуле скрипит. Стул треснул после полугода использования', 'Красовский Игорь<br>Елена, добрый день. Свяжитесь, пожалуйста, с нами по телефону +7 (988) 242-81-05. Мы бесплатно заменим Вам пластиковое сиденье. Вместе с сиденьем поставляется дополнительный упор, как раз он не дает сиденью треснуть.<br>Мы сами сидим на таких стульях в магазине, за 2,5 года не один не треснул.', '2013-10-23 15:04:05', '', '', 3, 1, '14-01', 'parta_so_stulom', '', ''),
(80, 'Лия', '', 'Купила сыну стул. Оч понравился. Он удобный, не позволяет ребенку вертеться, а главное, он соответствует росту, поэтому ноги не свисают и спину сын держит ровно.  ', '', '2015-02-23 20:17:46', 'stul_dly_shkolnika_dami.jpg', 'Стул для школьника', 5, 1, '', '', '', ''),
(35, 'Eлена', '', 'К столу нареканий нет, а вот спинка и сиденье у стула треснули', '', '2013-10-27 09:51:04', '', '', 0, 0, '', '', '', ''),
(36, 'олег', '', 'Парта сут 14-02 была приобретена для первоклашки, собрал комплект сам по инструкции, сборка не составила труда, все доходчиво, все отверстия на своих местах, ребенку и нам очень нравиться, о покупке не жалеем! ', '', '2013-11-05 23:37:31', '', '', 5, 1, '14-02', 'parta_so_stulom', '', ''),
(37, 'Николай', '', 'Парта «ДЭМИ» СУТ 14-02  пользуемся три года . Нареканий нет, о покупке не жалеем. Парта \"растет\" вместе с ребенком. Дочери очень нравится . Все продумано, удобно. Настоятельно рекомендуем.', '', '2013-11-07 16:36:26', '', '', 5, 1, '14-02', 'parta_so_stulom', '', ''),
(38, 'Фатима', '', 'довольны партой, даже очень. Ребенок занимается с большим удовольствием. Может несколько дороговато, но здоровье  бесценно', '', '2013-11-08 10:56:47', 'hsgoshfsdflsdf.jpg', '', 5, 1, '17-04m', 'parta_iz_massiva', '', ''),
(39, 'Сергей', '', 'Весной купили парту СУТ 17-04. Очень удобная. Хватает места и писать и читать и хранить на столе учебники и тетради. Дочери очень нравится. Собирается очень легко. Удивило как аккуратно запакована ))). К сожалению через некоторое время некоторые кромки вздулись... причем на нескольких деталях. Видимо брак попался. Порадовало что заменили быстро и без вопросов. \r\nНе так давно купили междустоечный навес СУТ 15 СМД.04. Тоже собрался легко, удивило что задняя стенка это тот же 12мм ЛДСП. Производитель явно не экономит, но при этом почему то не подумал что этот навес можно вешать отдельно! Пришлось придумывать как его к стене крепить :) и смирится с необработанными кромками с боку. Порадовало наличие доводчиков на петлях. В целом как эконом вариант немецких столов MOLL более чем достойный выбор. Несмотря на небольшие недостатки мы с семьей довольны покупкой.', '', '2013-11-09 19:06:21', 'парта_2.JPG', '', 5, 1, '17-04', 'parta_so_stulom', '', ''),
(40, 'Ирина', '', 'Отличная парта! Очень комфортно чувствует себя ребенок и 5 лет и 3х лет,очень надежная (выдерживает даже прыжки мелкого))))) Дочь занимается с удовольствием только на Своем рабочем месте.Осанка безупречна благодаря фирменной столешнице. Со сборкой проблем не было инструкция (как говорится для чайников) четкая и понятная. \r\np.s.Новая модель очаровала просто класс!!!!!Сыну возьмем обязательно!', '', '2013-11-14 15:19:16', '17-04_2014_04_26.jpg', '', 5, 1, '17-04', 'parta_so_stulom', '', ''),
(41, 'Сергей', '', 'Партой пользуются двое: брат с сестрой. Им очень нравится. Да и я сам иногда бочком присяду почитать что-нибудь, с наклонной поверхности читать лучше. Боковую полку пока не поставили - дети в школу ещё не ходят. Порадовала подробная инструкция и упаковка каждой детали в отдельный нумерованный пакет. Чтобы не суметь собрать самостоятельно, нужно быть или очень толстым и ленивым или абсолютно натуральной блондинкой. Общение с персоналом при покупке тоже оставило хорошие впечатления. Им, наверное, самим доставляет удовольствие продвигать такой качественный товар. \r\nИ вообще, приятно, что в нашей стране ещё работают предприятия, выпускающие очень достойную продукцию.', '', '2013-11-16 23:19:17', 'Дети-2 437.jpg', '', 5, 1, '14-01', 'parta_so_stulom', '', ''),
(42, 'Алексей', '', 'Парту собрал, дочка довольна, но Желдорэкспедиция в Волгограде отвратительная компания, на момент получения товара они перееехали на другой конец города ( работают там с понедельника), куда практически не добраться общественным транспортом и вместо 300 руб за свои услуги, указанные на сайте, взяли 623 рубля, упаковка была частично повреждена, хорошо что завод упаковывает хорошо, сама парта не пострадала. Спасибо.', '', '2013-11-24 11:55:19', '', '', 5, 1, '14-02', 'parta_so_stulom', '', ''),
(43, 'Алена', '', 'Знакомые в прошлом году купили на Котовского парту со стулом, мы поехали, а их там нет, хорошо, что буклет остался, позвонили, а они переехали на Тургенева. Нашли быстро. Купили светлую с серым, она под все подходит.  Дочка довольна и я тоже:мало места занимает.', '', '2013-11-25 11:55:36', '526468168.jpg', '', 5, 1, '14-01', 'parta_so_stulom', '', ''),
(44, 'вера', '', 'Купили парту со стулом .Очень довольны!Качество отличное!Стол очень удобный,ребенок стал правильно сидеть!Спасибо!', '', '2014-01-09 18:39:27', '51d44ed32e93.jpg', '', 5, 1, '14-01', 'parta_so_stulom', '', ''),
(45, 'Олеся', '', 'Купили парту со стулом и выкатной тумбой. Уже на следующий день выяснилось, что ребенок  (5 лет!)  все-таки умеет рисовать (!!!) и не только на стенах, затем с удовольствием начал играть в настольные игры. Надо отметить, что силиконовая накладка пригодилась сразу, успешно выполнив защитную функцию (кроме того, при наклоне книги не скользят). Выкатная тумба выше всех похвал - похоже, что изнутри больше, чем снаружи. Соотношение цена-качество идеальное. В общем, мы довольны, спасибо.', '', '2014-01-24 20:08:41', 'cdhgfru.jpg', '', 5, 1, '14-01', 'parta_so_stulom', '', ''),
(46, 'Татьяна', '', 'Заказывали парту и стул для дочери, огромное спасибо. Качественно и красиво. Дочь довольна. Занимает мало места. ', '', '2014-04-21 12:17:27', 'IMG_1886.JPG', '', 5, 1, '14-01', 'parta_so_stulom', '', ''),
(47, 'Андрей', '', 'Полгода назад купили парту 120 и стул к ней. Взяли из-за возможности регулировать угол наклонм, потому что сын постоянно наваливался на стол. Теперь сидит ровно, правда по началу пришлось заставлять, но привык быстро. ', '', '2014-04-26 13:42:40', 'IMG_1615.JPG', '', 5, 1, '15', 'parta_so_stulom', '', ''),
(48, 'Светлана', '', 'Приобрели  парту + стул   и стеллаж  ДЭМИ очень довольны !  Удобно, качественно  и красиво  сделано. Уроки делаем с удовольствием !!! Огромное спасибо! Советую всем родителям, позаботиться об осанке своих любимых деток. Очень удобно и комфортно ребенку заниматься за этой партой. ', '', '2014-05-01 15:03:02', 'img_hdfjhsdpc050009.jpg', '', 5, 1, '15-04', 'parta_so_stulom', '', ''),
(49, 'Екатерина', '', 'Добрый день! Отзыв посвящается всем сомневающимся родителям, желающим для своих любимых самого, самого! Купили парту СУТ 17-04(с раздельной столешницей) яблоня/серый , полочки навесные, тумба, силиконовая накладка(обязательно приобретайте, если хотите как можно дольше сохранить стол в отличном состоянии), стул и чехол оксфорд/синий! Собирали наш стол папа с сыном, качество супер, весь крепеж по отдельным пакетикам, упаковано все очень качественно! Дэми молодцы! Конструктор для взрослых! Собрали поставили, о счастье, нашего ребенка трое суток не было видно и слышно, раскладывал свои принадлежности, рисовал, читал, лепил и т.д. все за столом! Очень довольны, что не пожалели денег и купили парту с раздельной столешницей, это очень удобно! Полочки пришлось подвесить не к парте а к стене, так она занимает меньше места и стало очень уютно и максимально эргономично! Через годик будем покупать еще одну! Спасибо Дэми! ', '', '2014-05-06 12:55:25', 'IMG_1311.JPG', '', 5, 1, '17-04', 'parta_so_stulom', '', ''),
(50, 'Людмила', '', 'Приобрели недавно парту со стулом для дочери, она в 5 классе, но уже есть проблемы со спиной т.к. за обычным столом она не сидела, а лежала. За партой лежать ей не удобно, приходится сидеть нормально. Взяли парту нейтрального цвета с двумя полочками по бокам, очень удобно, ребенку нравится и смотрится  красиво. Надеюсь, что парта перейдет по наследству сыну, который пойдет в школу через 6 лет', '', '2014-05-14 00:10:08', 'IMG_4407.JPG', '', 5, 1, '14-02', 'parta_so_stulom', '', ''),
(51, 'Анна', '', 'Красивый дизайн, ребенок очень доволен. Ждем с нетерпением первый класс. Наконец нашли что искали. Быстро и удобно. ', '', '2014-05-20 19:53:35', 'd2d9250663d5b63c3e0e28536e94f609_h.jpg', '', 5, 1, '14-01', 'parta_so_stulom', '', ''),
(52, 'Полина', '', 'Хочу сказать спасибо фабрике и консультантам магазина. Купили парту со стулом. Все подсказали, оформили заказ быстро и в этот же день привезли. Собирать было легко по инструкции,  все понятно и лаконично. Получилось очень красиво, ребенок остался доволен. Лучший выбор для старшего дошкольника и школьника. Обязательно приедим еще за фкафчиком. ', '', '2014-05-21 07:04:55', 'fgropcb.jpg', '', 5, 1, '14-01', 'parta_so_stulom', '', ''),
(53, 'Елена', '89284006688', 'Купили вчера парту. Собрали быстро. Просто супер- ребенок безумно счастлив!!', '', '2014-07-03 10:17:27', '', '', 5, 1, '14-02', 'parta_bez_risunka', '', ''),
(54, 'Нана', '89189102723', 'Собирала сама . Парта нравиться по своим потребительским качествам. Сложности были с саморезами -вручную очень трудно физически вкручивать,кроме того не всегда получается ровно войти в деталь . Было бы хорошо предусмотреть фурнитуру для таких деталей при которой не нужно прикладывать физические усилия и винты входили строго ровно. Шайбы к задней полке в комплекте были ржавые. ', '', '2014-07-17 07:39:11', 'S1DPlA8iwCUg.jpg', '', 4, 1, '14-02', 'parta_bez_risunka', '', ''),
(56, 'Андрей', '', 'Обустраиваем для дочки комнату, и совсем случайно нашли в интернете мебель Дэми. Там такие интересные парты, стеллажи и тумбы. Заказали дочке растущую парту, стеллаж и тумбу, а еще эргономическое кресло. Все в одном стиле, с цветочками. Дочка нарадоваться не может. И нам очень понравилось и дизайн, и качество.', '', '2014-08-09 12:23:17', '', '', 5, 1, '', '', '', ''),
(55, 'nimfo4ka555', '', 'Делали ремонт в классе и решили заказать новые парты. Обратились в компанию \"Дэми\" и не прогадали. Парты очень хорошие и гарантия на них аж 5 лет.\r\n', '', '2014-08-08 10:17:13', '', '', 5, 1, '', '', '', ''),
(57, 'Наталья', '', 'Мы в прошлом году всем классом решили заменить парты и вот уже год прошел, а парты как новенькие. Так вот, для кого это актуально, советую компанию \"Дэми\", у них очень большой опыт, только советую пораньше делать заказ, т.к. потом будет очень много заказов в компании. Но качество отменное! И с гарантией.', '', '2014-08-10 12:26:07', '', '', 5, 1, '', '', '', ''),
(58, 'Ирина', '+79184498776', 'Парта очень понравилась и ребёнку и родителям. Угол наклона позволяет заниматься черчением и рисованием с руки(черчением папа занимается). Ребёнок очень рад. Пересмотрели много вариантов мебели. Секретер -практично, но дорого. Купили парту(пока детскую не сделали-парта живёт в зале). Фотку прилагаю.', '', '2014-08-11 11:06:03', 'DSC03864.JPG', '', 5, 1, '14-01', 'parta_bez_risunka', '', ''),
(59, 'Андрей Пастушенко', '', 'Заказывал тут для своего сына Парту Дэми. Всё выполнили в срок и с хорошим качеством . Очень красиво получилось. Ему очень понравилось. Думаю ему будет интересно учиться за такой прекрасной партой.', '', '2014-08-12 12:23:34', '', '', 5, 1, '', '', '', ''),
(60, 'Светлана В.', '', 'Теперь, когда у моего ребенка появилась парта Дэми, я спокойна за его осанку. Прекрасная, эргономичная детская мебель. Столько преимуществ - всего не перечислить. Одно могу сказать - это лучшее из того, что могли сделать конструкторы детской мебели для здоровья детей.', '', '2014-08-13 12:24:12', 'IMG_3404.JPG', '', 5, 1, '15', 'parta_bez_risunka', '', ''),
(61, 'Елена', '9282403370', 'Купили в конце июля, очень довольны, особенно сын, сборка самостоятельная, легко и быстро. Качеством довольны, спасибо!', '', '2014-08-23 19:58:55', 'IMG_khflkhmsdnfkdsf3875.jpg', '', 5, 1, '14', 'parta_bez_risunka', '', ''),
(62, 'Анна', '', 'Купила 2 комплекта парта+стул год назад. Пользуемся с удовольствием. Проблема одна: треснула спинки и сиденье на стуле, так что советую сразу покупать не из пластика. Комплектующие в Москве найти тяжело.', '', '2014-08-30 07:52:33', '', '', 4, 1, '', '', '', ''),
(63, 'Светлана', '', 'НЕ БЕРИТЕ пластиковые стулья!!!\r\nНа второй год использования треснуло сидение. Ребенок худенький. КАК можно вообще изготавливать ТАКИЕ НЕПРОЧНЫЕ сидения?', '', '2014-08-31 12:03:34', '', '', 4, 1, '', '', '', ''),
(64, 'Настя', '89182093965', 'Мы с мужем купили дочке на первый класс, уже после года эксплуатации, могу утвердительно сказать что парта хорошая, ничего не сломалось, очень функциональна и качество хорошее. По сравнению с другими похожими партами - цена супер. Советую брать чехол для стула, с ним удобнее, не пожалеете. Стирала в машинке ничего не случилось, все ОК.', '', '2014-08-31 15:20:08', '', '', 5, 1, '14-02', 'parta_bez_risunka', '', ''),
(65, 'Ирина', '8-918-972-31-26', '05.09.2014 получили свою парту. Покупали для девочки-первоклассницы, т.к. она у нас страшная вертушка, то обычный стол и крутящийся стул даже и рассматривали. Довольны все, особенно я и муж. Дочка сразу села за нее заниматься. Качество ОТМЕННОЕ!!!!! Собирается легко. Взяли стол с дополнительной боковой полкой+стул с чехлом из замши розового цвета+накладку на стол силиконовую+подставку для книг. В комнате можно поставить в любое место, компактно очень! Большое спасибо фабрике \"Дэми\" за такую замечательную мебель!!! Браво инженерам! И глаз радует, и эргономичная. Ни одного минуса в мебели не нашли! СУПЕР!!! Всем рекомендую данный продукт!', '', '2014-09-08 12:42:44', '2.jpg', '', 5, 1, '14', 'parta_bez_risunka', '', ''),
(66, 'Aleksandr', '+79085431071', 'Приобрели парту-трансформер Деми ,ребёнок рад,собрали легко,качество приятное.Рекомендуем эту марку!', '', '2014-09-29 23:18:56', '1034891597.jpg', '', 5, 1, '14-12', 'parta_iz_massiva', '', ''),
(67, 'Алик', '+79788006710', 'Партой пока только начинаем пользоваться , но ее конструктивные особенности полностью учитывают все нюансы формирования правильной осанки у первоклашек. \r\nМатериалы парты и качество обработки на \"5\". Пошаговая инструкция по сборке помогла легко и с удовольствием всей семьей  ее собрать. Также приятно удивило качество упаковки.  Спасибо пермякам за хорошую мебель. \r\nОтдельная благодарность представителю Partadami.ru Игорю за внимательное отношение к покупателям из Крыма.', '', '2014-10-01 17:50:23', 'Р¤РѕС‚Рѕ031[1].jpg', '', 5, 1, '14-01', 'parta_bez_risunka', '', ''),
(68, 'Елена', '89284443667', 'Купили ребёнку парту СУТ 14-02 со стулом. Пользуемя больше года. Муж собрал быстро, отрегулировал по росту ребёнка парту и стул. Ребёнок очень боволен, не сутулится. Рекомендую сразу купить накладку на парту и чехол на слул. Уже многим своим знакомым родителям порекомендовала. Рекомендую всем приобрести мебель Деми, тем более разнообразие моделей на любой вкус.', '', '2014-10-03 18:31:40', 'DSCN0286.JPG', '', 5, 1, '14-02', 'parta_bez_risunka', '', ''),
(69, 'Анна', '79788190665', 'Спасибо. Компания отличная, очень благодарна за то, что они сопровождают груз до самого получателя. На связь выходят моментально. Очень  довольна. Парта и тумба отличного качества', '', '2014-10-07 08:31:44', '35686559.jpg', '', 5, 1, '14', 'parta_bez_risunka', 'cyt14', ''),
(70, 'Алексей', '89173364300', 'Отличное качество! Продумано большинство моментов как в самой конструкции, так и в процессе сборки. Упаковано на 5 с плюсом! После сборки остались всего 2 детали: ключи для затягивания болтов и евровинтов.\r\nПожелание по усовершенствованию конструкции стула: я проложил между сиденьем и кронштейнами кусочки вспененного полиэтилена для уплотнения, можно и на спинке тоже положить тонкие прокладки, только не резиновые, а пластиковые.\r\nПожелание по документации: при сборке парты не указана рекомендуемая последовательность затягивания евровинтов в полку (5 шт), а для стула - забыли про шайбы при креплении сиденья.\r\nСтул очень понравился, в конструкции парты не очень удобны замки на ножках, я бы упростил конструкцию до надёжных штифтов (так обычно делали при социализме - просто и надёжно), а может и до болтов (не так уж часто приходится менять высоту).', '', '2014-10-22 23:21:38', 'DSC02555.JPG', '', 5, 1, '14-10', 'parta_iz_massiva', '', ''),
(71, 'Анастасия', '8 961 594-49-55', 'Купили парту и стул, все просто супер, у ребенка такая прямая спина, когда он сидит, профилактика сколиоза. И еще мне очень нравится разные положения парты. а на заднюю полку мы кладем тетради и учебники. Как жаль, что вы их не делали, когда я ходила в школу. Советую всем покупать парту и стул деми!!!', '', '2014-11-22 18:27:24', 'parta_dly_malchika.JPG', 'Парта для мальчика', 5, 1, '14-01', 'parta_bez_risunka', 'cyt14', ''),
(76, 'Вероника', '8-919-362-42-84', 'Уже купили две парты СУТ 14.02, дополнительно ещё по боковой полочке, подставку под системник. В планах купить выкатную тумбу с 3 ящиками и два навеса по 120см. Уж очень хочется удобной и качественной мебелью детскую доукомплектовать.\r\nP.S.: Первый раз в жизни собирала мебель. С 12-летней дочкой собрали по стулу, так интересно. Удобно, что в конце инструкции даете таблички под необходимый рост. Так и собирали: старшая для себя, а я для младшей. Всё получилось. Сборку парт оставили для папы - он тоже получил удовольствие. Спасибо.', '', '2014-12-03 14:35:31', 'parta_dly_devochki.JPG', 'Парта для девочки', 5, 1, '14-02', 'parta_bez_risunka', '', ''),
(73, 'Евгений', '79890839461', 'Если бы в моём детстве были такие парты, то я школу с золотой медалью закончил.)   Парта просто отличная, всем советую для своих детей!', '', '2014-12-01 12:51:06', 'stol_dly_shkolnika.jpg', 'Стол для школьника', 5, 1, '14-01', 'parta_bez_risunka', '', ''),
(74, 'Юлия', '+79282755667', 'Срасибо, очень довольны купили будущему первокласснику.Собирается легко.Стул собрала вместе с сыном.,легко и доступно.Парту оставили папе собирать.Все аккуратно.,понятно5+! ', '', '2014-12-02 22:56:30', 'parta_dly_doma.jpg', 'Парта для дома', 5, 1, '14', 'parta_bez_risunka', '', ''),
(77, 'Денис', '', '\r\n29,12,2014 приобрел комплект СУТ 14-02. Приобретением очень доволен! Порадовало качество качество материалов и качество их изготовления, все собирается в течении 1,5 часов неспешной работы. При приобретении выбор стоял между продукцией фирмы \"БЮРОКРАТ\" и \"ДЭМИ\", в соотношении цена/качество ДЭМИ лучше и дешевле!!! Рекомендую!!!\r\n\r\n', '', '2014-12-29 18:07:13', 'parta_dami_cyt14_02.JPG', 'Парта ДЭМИ СУТ14-02', 5, 1, '14-02', 'parta_bez_risunka', '', '178.155.28.253'),
(79, 'Ольга', '+79296286942', 'Очень довольны своей покупкой, парта удобная, большая, ребенок в восторге. Легкая регулировка позволяет ребенку самому выбирать необходимый наклон. Удобный желоб для канцелярских принадлежностей. Тумба имеет два ящика и пластиковый контейнер, поделенный на секции. Мы совершили удачную покупку чего и Вам желаем.', '', '2015-02-12 19:00:28', 'parta_dami_cyt17_05.jpg', 'Парта ДЭМИ СУТ17-05', 5, 1, '17-03-k', 'parta_bez_risunka', 'cyt17', '188.255.84.174'),
(78, 'Валентина', '89189393766', 'Парта отличного качества, очень удобна для будущего первоклассника!!!', '', '2015-02-03 14:34:30', 'parta_dami_cyt17.jpg', 'Парта ДЭМИ СУТ17', 5, 1, '17', 'parta_bez_risunka', '', '91.210.46.45'),
(81, 'Савелия', '', 'Ни сколько не пожалела что приобрела дочке данный комплект. Служит уже 2 года. Края у стола закругленные, что обеспечивает безопасность ребенку. Сама поверхность столика ламинированная, поэтому очень легко протирать. На самой столешнице яркий обучающий рисунок. Под столом огромный ящик, туда много всего помещается. Сам по себе комплект очень легкий, можно сложить и спрятать за дверь. Вообщем очень удобно. ', '', '2014-02-23 20:17:46', 'ydhjnsdfoewr2.jpg', '', 5, 1, 'doshkolenok', '', '', ''),
(82, 'Константин', '', 'Купили комплект СУТ 14-02. Доставили на следующий день. Собирали сами - 2 часа времени. Ниче сложного, все отверстия совпадают, в инструкции все подробно расписано, нужна только крестовая отвертка и ключ на 10. Вот только насадки от отвёртки все поломались и волдыри на руках, т.к. материалы из которых изготовлены саморезы, столешница и боковая полка качественные, а отверстия под саморезы не просверлены, а только помечены светлом... В остальном все класссссс!!!!!!\r\n\r\n', '', '2015-02-28 18:00:45', '2029908687.jpg', '', 5, 1, '14-02', 'parta_bez_risunka', 'cyt14', ''),
(83, 'Мадина', '', 'Парта просто зашибись все советую она очень удобная и практичная', '', '2015-03-09 23:10:30', 'parta_dly_devochki.jpeg', 'Парта для девочки', 5, 1, '14', 'parta_bez_risunka', 'cyt14', '95.161.239.44'),
(84, 'Петр', '89876499008', 'Сегодня купили данное изделие. Супер, мне бы такое в моем детстве, может и сколиоза не было бы.\r\nВсем рекомендую!!! И горжусь отечественным производителем. В Жо.у санкции...', '', '2015-03-14 20:18:21', 'parta_i_stul_dami.jpg', 'Парта и стул ДЭМИ', 5, 1, '14', 'parta_bez_risunka', 'cyt14', '178.78.26.243'),
(86, 'Марем', '9888055790', 'Получили свою парту, вчера собрали, любуемся. Очень понравилась как сама парта, так и то с каким вниманием сделано все, включая детали и с какой тщательностью упакована мебель, удивила скорость доставки и то что все что заказывали, в том числе и цвет деталей, все на отлично! Мы довольны, спасибо и производителям и магазину!', '', '2015-04-12 10:10:19', 'IMG_04472.JPG', '', 5, 1, '17-02', 'parta_bez_risunka', 'cyt17', '95.153.196.188'),
(89, 'Кермен', '89275910467', 'В этом году сынок идет в 1 класс. Мы долго выбирали какую парту ему лучше всего подойдет, и мы остановились на парте \"Дэми\". Парта и стул легко собираются. Сыну очень понравилось, он с удовольствием занимается. В будущем планируем приобрести стеллажи для книг. ', '', '2015-06-18 11:02:10', 'IMG_dhlksdjfi3818.jpg', '', 5, 1, '14-01r', 'parta_s_risunkom', 'cyt14', '85.26.164.208'),
(90, 'Катя', '89610736709', 'Довольна своей новой партой.Рисую,пишу и играю.Я так рада,что у меня есть эта парта.', '', '2015-06-28 22:00:50', 'image9834878243.jpg', '', 5, 1, '14-01', 'parta_bez_risunka', 'cyt14', ''),
(91, 'Сергей', '', 'Здравствуйте!!! Хочу выразить Вам огромную благодарность за рекомендации при выборе парты и стула для дочери. Восторга и положительных эмоций от полученного подарка не было предела. Всё очень удобно и компактно, а самое главное, что полезно для здоровья ребенка. Обязательно будем рекомендовать знакомым семейным парам. Всё самое лучшее - для детей!!! ', '', '2015-07-11 21:33:51', 'aUkIj_YkAvo.jpg', '', 5, 1, '', '', '', ''),
(92, 'Анастасия', '+79182108816', 'Шикарные парты.\r\nВообще никаких претензий ни к чему.\r\nКачество на высоте.\r\nСобирается очень просто и быстро.\r\nГлавное не игнорировать инструкцию по сборке :-)\r\nСпасибо.\r\nЦена конечно кусается немного, но ради детей можно себе в чём то отказать.', '', '2015-08-03 13:25:38', 'IMG_20150803.jpg', '', 5, 1, '14', 'parta_bez_risunka', 'cyt14', '46.159.21.171'),
(93, 'Елена', '+7 918 250-55-17', 'Купили полный комплект вместе со стулом, чехлом и подставкой для книг для первоклассника. Вся мебель упакована отлично, переложена пенопластом. Сборка занимает мало времени, минимальное кол-во инструментов, инструкция расписана очень подробно, разберется даже ребенок. Все комплектующие выполнены на отлично, компоненты окрашены качественно. Большое количество регулировок делает эту парту универсальной во всех направлениях. Планируем приобрести еще один такой наборчик (парта+стул) и всем советуем. Придраться не к чему.', '', '2015-08-15 22:46:04', 'IMAG0187.jpg', '', 5, 1, '14-02', 'parta_bez_risunka', 'cyt14', '31.181.225.113'),
(94, 'Елена', '8 9603400675', 'Всем добрый день! К началу учебного года купили нашему первокласснику парту. Покупали через интернет-магазин с доставкой в другой город. Все четко организовано, через 3 дня парта была уже дома. Собрали без труда, даже \"хозяина\" парты привлекали. И вот уже несколько дней, как делаем уроки и с удовольствием наблюдаем, что сыну очень удобно и комфортно. Спина прямая, осанка правильная. Огромное спасибо всем, кто придумал и сделал такую замечательную школьную мебель.', '', '2015-09-04 09:16:14', 'DSC06821.JPG', '', 5, 1, '14', 'parta_bez_risunka', 'cyt14', '77.94.200.116'),
(101, 'Лилия', '', 'Добрый вечер! Приобрели летом для нашей первоклассницы комплект детской мебели \"ДЭМИ\". Парта со стульчиком уехали из магазина в городе Волгограде в город Костанай!!! Совсем недавно собрали! Нам очень понравилось!!!Спасибо, \"ДЭМИ\"!!! И успехов всем школьникам!!!', '', '2015-09-21 20:21:16', 'ДЭМИ.png', '', 5, 1, '', '', '', ''),
(112, 'Николай', '+79514325631', 'Отличная парта. Купили для сына.Быстрая простая сборка. Удобные регулировки (особенно у стола). Единственный минус - у нас тоже лопнуло сиденье стула. А в целом довольны. Пользуемся третий год.', '', '2016-01-19 20:54:01', 'IMG_20160119_224411.jpg', '', 5, 1, '14-01', 'parta_bez_risunka', 'cyt14', '176.226.189.73'),
(100, 'Марина', '8-918-460-27-45', 'отличная парта и хорошее качество!!!!!!!! спасибо вам огромное.....правда собирали долго,но собрали....купили ребенку на 1 класс, дочь очень довольна. спасибо', '', '2015-09-19 20:25:15', 'DSC02906.JPG', '', 5, 1, '14-01', 'parta_bez_risunka', 'cyt14', '95.30.58.81'),
(96, 'Мария', '89023849002', 'Купили парту для первоклассника. Собрали достаточно быстро. Компактная. Думаю, важно, что такая парта приучает к порядку - ничего лишнего на столе. Сыну очень удобно.', '', '2015-09-10 11:18:50', 'IMAG1108[1].jpg', '', 5, 1, '24', 'white', 'cyt24', '2.92.40.43'),
(99, 'Яна', '89160792757', 'Спасибо Дэми за потрясающую порту которая растет вмести с ребенком! Ребенок пользуется партой уже год. Нет никаких нареканий! Все продумано до мелочей! Спасибо! ', '', '2015-09-19 10:03:38', 'Изображение.jpg', '', 5, 1, '14-01', 'parta_bez_risunka', 'cyt14', '91.210.94.104'),
(102, 'Инна', '89033708332', 'Купили парту сыну -первоклашке. Вопрос осанки важен, поэтому  выбор пал именно на парту Дэми. Сыну очень понравилось. Собрали быстро. Дополнительный плюс-яркие накладки на выбор (В нашем случае нужен был красный цвет). А так же наличие парты белого цвета. Так как мебель в детской белая с красным. Очень довольны. ', '', '2015-09-26 09:07:08', '5U7A2676.JPG', '', 5, 1, '24', 'white', 'cyt24', '128.73.88.100'),
(103, 'АЛЛА', '', 'Пользуемся партой уже 4 год. Очень Довольны. Все работает. Вид сохранился как  новый. Хотя износ повышенный 2 детей. Собираемся покупать вторую парту второму ребенку.', '', '2015-09-30 09:34:31', 'bEYTdR3MoUg.jpg', '', 5, 1, '14-01', 'parta_bez_risunka', '', '37.78.112.238'),
(104, 'Зоя', '', 'Партой очень довольны! Советую всем, смело покупайте,не пожалеете!', '', '2015-10-03 11:11:40', 'P_20151003_074807.jpg', '', 5, 1, '14-02', 'parta_bez_risunka', 'cyt14', ''),
(105, 'Вячеслав', '', 'Купили дочери парту Дэми, ладно ребёнку, даже жене нравится. Собрал её быстро. Приятный стульчик. Дочь на ней и уроки делает, рисует и читает! Очень нравится!', '', '2015-10-04 14:42:34', 'LZyOobWmglM.jpg', '', 5, 1, '', '', '', ''),
(106, 'Юлия', '', 'Класс! Спасибо за парту! Долго подбирала разные столики и стульчики. Потом увидела в интернете описание Дэми... Супер! Дочь из-за парты не вытянешь)))', '', '2015-10-04 15:03:06', 'DSC_8866.JPG', '', 5, 1, '15', 'parta_bez_risunka', 'cyt15', ''),
(107, 'андрей', '8 921 272-10-57', 'Здравствуйте. Получили заказанную парту на двое суток раньше.Собирали вместе с сыном.Собирается легко.качество хорошее.', '', '2015-10-24 10:16:05', '20151024_100851.jpg', '', 5, 1, '14-12', '', '', '217.66.156.168'),
(108, 'ДАрья', '', 'Купили парту, внешне очень понравилась, собрали по инструкции без проблем. Ребенок сел, я без нажима подняла столешницу, что-то клацнуло. Оказалось, один из 3-х шурупов, крепивших механизм, вырвал кусок столешницы. Усилий никто не прилагал! Все скручено согласно инструкции! Наш класс хочет закупить более 30 парт.. Я теперь против! Они рассчитаны на очень аккуратное обращение, даже столешницу ( по инструкции) нельзя поднимать ребенку! Только взрослому! В школе, на мой взгляд, это невозможно проследить. На стуле, при сборке оказались какие-то потертости-царапины. Мы не распечатывали коробки в магазине, особо не расстроились, тк сверху одели чехол. В общем, не в восторге я от покупки. Посмотрим на сколько хватит чудо-парты от первого класса до института, кстати, срок эксплуатации, заявленный производителем всего 3 года, затем рекомендуется утиль... Короче, раза 4, как минимум, придется покупать', '', '2015-10-31 23:35:15', '11632377_bfjshdkf.jpg', '', 3, 1, '14', 'parta_bez_risunka', 'cyt14', '95.153.133.241'),
(109, 'Александр', '89054848785', 'Шикарная пакрта! Качество на высоте, дерево тяжелое, массивное, все крепления не вызывают сомнений. Видно что продумана каждая мелочь. Упаковано отлично. Инструкция по сборке даже слишком подробная. За такую цену просто не имеет конкурентов (вернее просто \"имеет\" их:))', '', '2015-11-01 14:04:44', '1446375706710-143869468.jpg', '', 5, 1, '17-04-d1', 'parta_bez_risunka', 'cyt17', '66.102.9.78'),
(110, 'Анна', '', 'Партой Дэми дочка пользуется 5 год. С партой все хороша. А вот стул пластиковый продержался менее 2-х лет, треснуло сидение. И, судя по отзывам, не только у нас. ', '', '2015-12-11 21:50:14', '', '', 3, 1, '', '', '', ''),
(111, 'Маргарита', '8 962 853-26-22', 'Здравствуйте, мне очень понравилась эта парта,парта для девочки розовая,удобная,качественная,я очень рада, что выбрала именно эту парту,спасибо вам,что поставляете такую удобную,качественную продукцию. ', '', '2016-01-06 01:03:29', '1532013494.jpg', '', 5, 1, '14-02', 'parta_bez_risunka', 'cyt14', '188.162.166.165'),
(113, 'Андрей', '+79286634933', 'Отличная парта. Дочка в этом году пойдет в 1класс, для ее роста 120см подошла как раз начальная ростовка парты. Сборка довольно муторная, если собирать самому, т.к.парта тяжелая и реально без шуруповерта тяжко. Зато каких то 3 часа в позе \"зю\" и минимум до универа не паришься))). Хороший продукт - надо брать. ', '', '2016-01-22 08:28:34', 'image12uu320u40234.jpg', '', 5, 1, '17-04', 'parta_bez_risunka', 'cyt17', '95.153.132.63'),
(114, 'Лилия', '79676633767', 'Огромное спасибо!!!!!Парта безподобная ,ребёнок остался доволен!!!', '', '2016-02-13 20:33:20', 'imagehfuew84902.jpeg', '', 5, 1, '14', 'parta_bez_risunka', 'cyt14', '178.155.9.63'),
(115, 'Юлия', '89181278831', 'Парту выбирала давно. Ребенок в этом году идет в первый класс и нужно позаботится о осанке и удобстве делать уроки. Собрали быстро ( инструкция хорошая), все просто как в Икеевской мебели, деталька к детальке. Стул тяжелый - это и хорошо, меньше ёрзать будет, взяли с фанерной спинкой и сиденьем + чехол. Стол большой ( у нас сут -14 + задняя и боковая полка).', '', '2016-02-13 20:52:51', 'IMG_20160213_202445 (1).jpg', '', 5, 1, '14-02', 'parta_bez_risunka', 'cyt14', ''),
(116, 'Дмитрий', '89183836683', 'Наш стол со стулом Дэми был куплен 9 лет назад старшему сыну, он его очень любил, но вырос и отдал младшему брату, который тоже вырос.  Качество на высоте. Столик еще в нормальном состоянии:) Стульчик выдержал 7 лет. Младшему на смену и к школе купили Сут -14 со стулом и полками.', '', '2016-02-14 17:11:57', 'IMG_20160214_165300.jpg', '', 5, 1, 'doshkolenok', 'detskaya_skladnaya_mebel', '', '62.183.124.63'),
(117, 'павел', '89282086479', 'Парта супер. Подробная инструкция по сборке. Крепкие и надежные материалы и механизмы. Ребенку даже и трех лет удобно за ней рисовать и лепить из пластилина. Так, что мы довольны покупкой! ', '', '2016-02-19 14:25:16', '1455880940100.jpg', '', 5, 1, '14', 'parta_bez_risunka', 'cyt14', '217.118.81.217'),
(118, 'Александр', '+7 (902)314-65-10', 'Парта очень понравилась. Стул удобный,брал с фанерой-очень крепкий. Собрал всё сам, инструкция понятна. Всей семья довольна, особенно сын 9 лет, для котрого и была куплена. Купил ещё заднюю и боковую полку, но пока не поставил, так как не определился с местом установки стола. Из недостатков-нельзя переносить стол за верхнюю крышку, достаточно тяжёлый, но часто его не двигаешь, поэтому нормально. ', '', '2016-03-12 20:04:29', '1457802176257-111677407.jpg', '', 5, 1, '14', 'parta_bez_risunka', 'cyt14', '94.233.41.147'),
(124, 'Евгений', '+7 918 238-47-66', 'Купили парту СУТ21. Довольны все- и ребенок и родители!', '', '2016-05-19 11:57:48', 'DSC_0902.JPG', '', 5, 1, '21', 'parta_bez_risunka', 'cyt21', ''),
(125, 'Максим', '', 'Отличная парта, собирается легко. Ребенок доволен', '', '2016-06-01 13:13:41', 'IMG_0454dshflsdf.JPG', '', 5, 1, '17-03', 'parta_bez_risunka', 'cyt17', '178.34.32.183'),
(126, 'Мария', '89189763499', 'Парта собирается легко,в инструкции все подробно описано и подписаны названия всех болтиков (что важно,если не занимаешься сборкой постоянно). Сама парта очень компактная,благодаря силиконовой накладке тетради не соскальзывают.Чехол отлично подходит к стулу - очень мягко сидеть! ', '', '2016-06-11 11:55:32', 'SAM_3427.JPG', '', 4, 1, '14', 'parta_bez_risunka', 'cyt14', '85.173.22.95'),
(127, 'анатолий', '', 'Купил тут парту и стул.Оплатил.Отправили.Получил. Все отлично.Парта просто \"бомба\", металл.конструкции толстостенные и дсп,механизм довольно прочный поэтому получилась очень устойчивая парта.Мониторил цены, здесь оказалось дешевле. Спасибо.   ', '', '2016-07-04 18:10:22', 'DSC_0389.jpg', '', 5, 1, '21', 'parta_bez_risunka', 'cyt21', '62.76.12.244'),
(122, 'Елена', '89183777162', 'Выбирая парту ориентировались на показатели цена-качество. В итоге остановились на данном производителе. Покупкой очень довольны. Сын оценил, занимаемся на ней с удовольствием! Возможность регулировать высоту парты и угол наклона считаю очень удобной и значимой, так как от этого на прямую зависит правильное положение рук при письме и правильная осанка! \r\nСобирали просто и быстро. Качество отличное. Рекомендую', '', '2016-03-31 13:59:54', 'imagejdflshdlfhldshnd.jpeg', '', 5, 1, '17-01-d1', 'parta_bez_risunka', 'cyt17', ''),
(123, 'Татьяна', '89034793244', 'Купили дочке на день рождения и к первому классу. Ребенок доволен! Качество хорошее. Брали по акции.', '', '2016-04-04 20:52:46', 'IMG-1459781683697-V[1].jpg', '', 5, 1, '14-02', 'parta_bez_risunka', 'cyt14', '188.233.33.242'),
(128, 'Дмитрий', '89275351101', 'Хорошая парта, покупали дочке дошкольного возраста, чтоб заниматься. Дочке очень понравилась парта.', '', '2016-08-14 12:26:53', '20160814_121155.jpg', '', 5, 1, '', '', '', '');
INSERT INTO `gb` (`id`, `username`, `phone`, `msg`, `answer`, `dt`, `img`, `alt`, `total_value`, `total_votes`, `url`, `category`, `art`, `ip`) VALUES
(129, 'Владислав', '89180237878', 'Посоветовала сестра купить именно Деми, приехал в магазин, расположенный на улице Тургенева 56.Все устроило, ребята продавцы молодцы, подсказали все что надо. Дома собрал буквально за пару часов с перекурами. Всем парта понравилась. Я не так часто собираю мебель, но впервые столкнулся с качественной русской мебелью с ПОЛНЫМ КОМПЛЕКТОМ ВСЕХ САМОРЕЗОВ, БОЛТОВ, ШУРУПОВ и СТОЛЬ ПОДРОБНОЙ ИНСТРУКЦИЕЙ. Главное ребенок доволен. Спасибо.', '', '2016-09-08 09:33:02', 'R1qScLil8jk.jpg', '', 5, 1, '14', 'parta_bez_risunka', 'cyt14', ''),
(130, 'Любовь', '+79884869340', 'Купили парту внуку, очень удобно, внук с удовольствием делает задания, что не мало важно. Покупали в магазине на Тургенева, продавец все объяснил грамотно. Может и дороговато, но это этого стоит, тем более, что покупается не на один год, и парта и стул растут вместе с ребенком.', '', '2016-09-09 09:33:02', 'EH4G-MJo5n4.jpg', '', 5, 1, '', '', '', ''),
(131, 'Рустам', '89660234312', 'Тоже заказывали парту Дэми. Качество сборки очень добротное, ребенку сидеть удобно. Рекомендуем всем своим знакомым!', '', '2016-09-25 20:02:31', 'фото парты.jpg', '', 5, 1, '', '', '', '31.173.80.123'),
(132, 'Сергей', '8-915-310-53-54', 'Отличная парта! Очень доволен покупкой, дочка в восторге!', '', '2016-09-26 17:27:24', '', '', 5, 1, '', '', '', '217.78.180.236'),
(133, 'Андрей', '89064088966', 'Купили парту СУТ14 + стул + полка задняя + 2 боковые полки (из расчета на будущее, живем в однушке, - в планах переезд) 04.01.2017 года. При сборке проблем не возникло (кроме перекошенного замка стойки, но в умелых руках и это не проблема, - исправил).\r\nГлавный недостаток - отсутствие полки под клавиатуру (пусть даже и за отдельную плату как и другие полки), главное заднюю полку сделали под монитор а на эту что ума не хватило, придется самому липить.\r\nПредлагаю рассмотреть мое предложение.\r\nРебенку очень понравился стол, теперь у ребенка есть свое рабочее место, в этом году в школу.', '', '2017-01-15 20:28:58', '', '', 4, 1, '', '', '', '31.180.170.107'),
(134, 'Елена', '', 'СУТ 01.01. со стулом. Цвет и качество очень порадовали. Возникло неудобство при сборке парты: место куда крепится поперечина (под партой длинная доска такая узкая)почти совпадает с ножкой опоры и мужчине с крупными руками было очень трудно прикрутить детали, - элементарно рукой не подлезть чтобы нормально всё скрепить( хотя, делали по инструкции и в правильном порядке),но справились. Доставка из Краснодара в Новороссийск - быстрая.Правда, цена доставки оказалась выше чем в калькуляторе(400+350), видимо, какая то наценка в пункте выдачи.Зато, порадовала брошюрка для родителей первоклассника  которая была в упаковке со стульчиком, спасибо.  ', '', '2017-05-21 22:35:30', 'P5210497.JPG', '', 4, 1, '29', 'parta_bez_risunka', 'cyt29', '195.208.172.104'),
(145, 'Светлана', '', 'Заказали комплект СУТ.14 со стулом и с тумбой. Очень довольны. Советуем', '', '2018-01-11 14:42:30', '12987398374.jpg', '', 5, 1, '14', 'parta_bez_risunka', 'cyt14', '62.183.125.111'),
(136, 'Марина', '', '+', '', '2017-06-23 18:14:55', 'IMG_5279.JPG', '', 5, 1, '25-03-k', 'white', 'cyt25', '188.162.166.73'),
(137, 'Виктория', '', ')', '', '2017-06-24 12:20:18', 'IMG_5294.jpg', '', 5, 1, '25-04-d1', 'white', 'cyt25', '188.162.167.214'),
(138, 'Елена ', '', 'Здравствуйте, заказали парту СУТ-17,получили вовремя,всё соответствует фото. Дочка очень довольна, уже занимается. У сына СУТ-14 уже 4 года и ни одной поломки. Всё великолепно вытирается.Спасибо огромное!', '', '2017-06-27 09:48:12', '20170621_114505.jpg', '', 5, 1, '17-03', 'parta_bez_risunka', 'cyt17', '85.115.248.248'),
(139, 'Елена', '', '+', '', '2017-07-01 12:12:36', 'IMG_5316.JPG', '', 5, 1, '17-03', 'parta_s_risunkom', 'cyt17', '188.162.167.87'),
(140, 'Алена', '', 'Отличная парта и кресло, дочка в восторге. Сидеть очень убодно, настроили точно под рост и заблокировали колескики у кресла чтоб не крутилась и не каталась', '', '2017-07-19 16:19:32', 'IMG_5287.JPG', '', 5, 1, 'comf_pro_match', 'mealux', 'cyt', '188.162.167.31'),
(141, 'Светлана', '', 'Купили 3 года назад комплект мебели, и спустя 2 года пошли трещины на стуле (пластик сидушка)  ((( И вот спустя ещё год уже дырень. И это за такие деньги. Стыдно должно быть производителю. Ни о каких 80 кг нагрузки и речи быть не может в таком случае. Хотя бы уже комплектующее отдельно продавали, раз знаете о проблеме.\r\nК парте нареканий никаких нет. Удобно и комфортно.', '', '2017-09-22 12:42:57', '', '', 3, 1, '', '', '', '37.44.47.87'),
(142, 'Яна', '', 'Покупали парту давно, дочь уже в 6 классе. И вторая дочка свою парту уже 3й год \"юзает\". Все в отличном состоянии. Только чехлы стирать нужно:)\r\nНа крючки вешали портфель, крючок на месте. \r\nТак что проверено временем.', '', '2017-09-26 11:39:42', 'IMG-20170926-WA0012.jpg', '', 5, 1, '14', 'parta_bez_risunka', 'cyt14', '66.102.9.142'),
(149, 'Марина', '', 'Купили парту вместе с креслом, очень довольны', '', '2018-09-04 11:53:51', '38775250_432388710499389_2266076959287017472.jpg', '', 5, 1, 'comf_pro_match', 'mealux', 'cyt', '188.162.166.26'),
(150, 'Алина', '', 'Шикарное кресло, регулируется и по высоте и по глубине и главное ребенок не катается а сидит ровненько ', '', '2018-09-12 11:55:09', '19986132_102001273771624_2444065235871465472.jpg', '', 5, 1, 'comf_pro_match', 'mealux', 'cyt', '188.162.166.26'),
(143, 'Валентина', '', 'Отличное качество за небольшие деньги. Ребенок доволен.', '', '2017-12-29 10:37:40', '1273987234.jpg', '', 5, 1, '28', 'parta_bez_risunka', 'cyt28', '62.183.124.179'),
(144, 'Виктор', '', 'Пользуемся уже год, проблем нет. Уже один раз отрегулировали высоту. Скоро надо тумбочку. Всем совету/', '', '2018-01-10 11:37:41', '287484758834.jpg', '', 5, 1, '24-02-d', 'white', 'cyt24', '62.183.124.179'),
(146, 'Святослав', '', 'Очень удивила простота сборки, собирается и без инструкции понятно как. Качество хорошее, рекомендую', '', '2018-01-13 14:45:40', '212193891243.jpg', '', 5, 1, '26', 'techno', 'cyt26', '62.183.125.111'),
(147, 'Егор', '', '+', '', '2018-01-15 14:47:15', '9485767339.jpg', '', 5, 1, '17-04-d1', 'parta_bez_risunka', 'cyt17', '62.183.125.111'),
(151, 'Марина', '', 'Купили парту вместе с креслом, очень довольны', '', '2018-09-04 11:59:27', '38775250_432388710499389_2266076959287017472_n.jpg', '', 5, 1, '25-04-d1', 'white', 'cyt25', '188.162.166.26'),
(152, 'Светлана', '', 'Нам в школу только через год,  но мы уже начали готовиться потихоньку, рисовать, уроки делать,  привыкать ровно сидеть :)', '', '2018-09-19 12:10:22', '39486240_1898739807087313_7005035211020828672_n.jpg', '', 5, 1, '24', 'white', 'cyt24', '188.162.166.26'),
(153, 'Василий', '', 'Отличная парта, пользуемся уже 5 лет, проблем нет', '', '2018-10-24 12:00:49', '44891363_276179059769737_2058915816555790516_n.jpg', '', 5, 1, '17-03', 'parta_bez_risunka', 'cyt17', '176.59.83.237'),
(154, 'Ирина', '', 'Замечательная парта и тумба. Стул тяжеловат, но зато ребенок не вертится', '', '2018-11-16 12:03:27', '40593514_271957233643468_6272187964104183856_n.jpg', '', 5, 1, '14', 'parta_bez_risunka', 'cyt14', '176.59.83.237'),
(155, 'Карен', '', 'Качество на уровне. Заказывали доставку и сборку, ребята молодцы, сработали четко.', '', '2018-11-20 12:08:22', '44503422_279506049363779_6115115048563745677_n.jpg', '', 5, 1, '17-03', 'parta_bez_risunka', 'cyt17', '176.59.83.237'),
(156, 'Светлана', '', 'Купили парту для ребёнка 5 лет, стул получили в подарок. Вроде до 15 февраля действует акция. В следующем году нужно ходить на подготовку в школу, поэтому приобрели заранее. Производитель утверждает, что хватит до конца школы. Сейчас на минимальной высоте всё установлено, ноги стоят на полу, как положено. Качество нас вполне устроило.', '', '2018-12-27 13:47:54', '', '', 5, 1, '', '', 'cyt', '188.17.152.70');
